import React from "react";

function TodoItem(props) {
  let answerLabel;
  if (props.attributes.answer != null || props.attributes.answer != undefined) {
    answerLabel = "Answer: ";
  } else {
    answerLabel = "No response";
  }

  return (
    <div>
      <div>Question: {props.attributes.question} </div>
      <div>
        {answerLabel}
        {props.attributes.answer}
      </div>
    </div>

    // <div className="flex-row-center">
    //   <input type="checkbox"></input>to do
    // </div>
  );
}

export default TodoItem;
